import React from 'react'; // Import the Component component from React
import {Link} from 'react-router-dom'; // Import the Link component
import '../css/App.css';
import HomepageProject from './homepageProject.js'
import HomepageProjectVideo from './homepageProjectVideo.js'

const panaseer = {
  'image':require("./../content/projects/panaseer/thumbnail.png")
}

const joyStory = {
  'image':require("./../content/projects/joyStory/thumbnail.png")
}

const beatbox = {
  'video':require("./../content/projects/beatbox/teaser.mp4")
}

const project_total = "3"

function Home(props) {
  return (
    <div>
      <HomepageProject
       projectKey={'panaseer'}
       image={panaseer.image}
       number="1"
       total={project_total}
      />
      <HomepageProject
      projectKey={'joyStory'}
       image={joyStory.image}
       total={project_total}
      />
      <HomepageProjectVideo
        rojectKey={'beatbox'}
       video={beatbox.video}
       total={project_total}
      />

    </div>
  );
}

export default Home;
